import{_ as o,o as t,c as a,N as d}from"./chunks/framework.2f525601.js";const s=JSON.parse('{"title":"HTTP 状态码","description":"","frontmatter":{},"headers":[],"relativePath":"base/network/httpStatus.md","lastUpdated":1729668942000}'),c={name:"base/network/httpStatus.md"};function p(r,e,i,l,n,h){return t(),a("div",null,e[0]||(e[0]=[d('<h1 id="http-状态码" tabindex="-1">HTTP 状态码 <a class="header-anchor" href="#http-状态码" aria-label="Permalink to &quot;HTTP 状态码&quot;">​</a></h1><h2 id="分类" tabindex="-1">分类 <a class="header-anchor" href="#分类" aria-label="Permalink to &quot;分类&quot;">​</a></h2><ul><li><p>1**：信息，服务器收到请求，需要请求者继续执行操作</p></li><li><p>2**：成功，操作成功接收并处理</p></li><li><p>3**：重定向，需要进一步的操作完成请求</p></li><li><p>4**：客户端错误</p></li><li><p>5**：服务端错误</p></li></ul><h2 id="常见的http状态码" tabindex="-1">常见的<code>Http</code>状态码 <a class="header-anchor" href="#常见的http状态码" aria-label="Permalink to &quot;常见的`Http`状态码&quot;">​</a></h2><h3 id="_2" tabindex="-1"><code>2\\*\\*</code> <a class="header-anchor" href="#_2" aria-label="Permalink to &quot;`2\\*\\*`&quot;">​</a></h3><p>200<code>（OK）</code> ： 服务器成功执行客户端的请求</p><p>201<code>(&quot;Created&quot;)</code>：当服务器依照客户端的请求创建了一个新资源时，发送此响应代码</p><p>202： 已接受</p><p>204<code>(&quot;No Content&quot;)</code>：若服务器拒绝对 <code>PUT、POST</code> 或者 <code>DELETE</code> 请求返回任何状态信息或表示，那么通常采用此响应代码，服务器也可以对<code>GET</code>请求返回此响应代码，这表明“客户端请求的资源存在，但其表示是空的</p><p>205： 成功，重置内容</p><p>206： 成功，部分内容</p><h3 id="_3" tabindex="-1"><code>3\\*\\*</code> <a class="header-anchor" href="#_3" aria-label="Permalink to &quot;`3\\*\\*`&quot;">​</a></h3><p>301： 永久移动，重定向</p><p>302： 临时移动，可使用原有 <code>URI</code></p><p>303<code>(&quot;See Other&quot;)</code>：请求已经被处理，但服务器不是直接返回一个响应文档，而是返回一个响应文档的 <code>URI</code></p><p>304<code>(&quot;Not Modified&quot;)</code>：（协商缓存）响应实体主体都必须为空</p><p>305： 需代理访问</p><p>307<code>(&quot;Temporary Redirect&quot;)</code>：请求还没有被处理，因为所请求的资源不在本地</p><h3 id="_4" tabindex="-1"><code>4\\*\\*</code> <a class="header-anchor" href="#_4" aria-label="Permalink to &quot;`4\\*\\*`&quot;">​</a></h3><p>400： 服务器无法处理请求，因为请求中存在语法错误或格式不正确。客户端需要修改请求后重试</p><p>401<code>(&quot;Unauthorized&quot;)</code>：认证拒绝，请求需要用户身份验证，客户端应提供有效的身份验证凭证（如登录、API token 等）</p><p>403： 权限不够，拒绝请求，与 401 不同，提供身份验证也不会改变结果，因为客户端没有足够权限。</p><p>404<code>(&quot;Not Found&quot;)</code>：404 表明服务器无法把客户端请求的 <code>URI</code> 转换为一个资源</p><p>405 (<code>Method Not Allowed</code>)：请求的方法（如 <code>GET</code>, <code>POST</code>, <code>PUT</code>, <code>DELETE</code> 等）不被服务器允许，可能是客户端试图用错误的 <code>HTTP</code> 方法访问资源。</p><h3 id="_5" tabindex="-1"><code>5\\*\\*</code> <a class="header-anchor" href="#_5" aria-label="Permalink to &quot;`5\\*\\*`&quot;">​</a></h3><p>500<code>(Internal Server Error)</code> ：服务器内部错误，无法完成请求</p><p>501<code>(Not Implemented)</code>：服务器不支持请求的功能，无法完成请求</p><p>502<code>(Bad Gateway)</code>：作为网关或者代理工作的服务器尝试执行请求时，从远程服务器接收到了一个无效的响应</p><p>504<code>(Gateway Time-out)</code>：充当网关或代理的服务器，未及时从远端服务器获取请求</p>',29)]))}const q=o(c,[["render",p]]);export{s as __pageData,q as default};
